help_controls_move_down:"Descendre",help_controls_move_up:"Monter",help_controls_rotate:"Faire pivoter la cam\u00e9ra",help_controls_zoom:"Zoom avant / arri\u00e8re",help_detailed_instructions:"Instructions d\u00e9taill\u00e9es",help_p1:"On vous pr\u00e9sente une g\u00e9om\u00e9trie de faces. Certaines faces contiennent des mines (bombes), d'autres non. Si vous cliquez sur une face contenant une bombe, vous perdez. Si vous parvenez \u00e0 cliquer sur toutes les faces (sans en cliquant sur les bombes) vous gagnez ",
help_p2:"En cliquant sur un visage d\u00e9pourvu de bombe, vous obtenez le nombre de visages voisins contenant des bombes. Utilisez ces informations, ainsi que des hypoth\u00e8ses pour \u00e9viter les bombes. Les visages voisins peuvent \u00eatre les visages partageant une ar\u00eate ou un sommet. ",help_p3:"Pour ouvrir une face, pointez-la et cliquez dessus. Pour marquer une face que vous pensez \u00eatre une bombe, pointez et faites un clic droit pour placer un drapeau. Les faces marqu\u00e9es ne peuvent pas \u00eatre ouvertes. Cliquez avec le bouton droit de la souris sur une face marqu\u00e9e. placez un point d'interrogation (cliquez sur ce visage). Supprimez le point d'interrogation en cliquant \u00e0 nouveau avec le bouton droit de la souris. ",
help_p4:"Une face 'voisins' sont les faces adjacentes situ\u00e9es au-dessus, au-dessous, \u00e0 gauche, \u00e0 droite et toutes les 4 diagonales, ou les faces partageant un sommet avec la face (Valide pour les g\u00e9om\u00e9tries 3D). Les faces des c\u00f4t\u00e9s de la g\u00e9om\u00e9trie ou dans un coin ont moins de voisins. ",help_p5:"Si vous ouvrez une face avec 0 bombes voisines, toutes ses voisines s'ouvriront automatiquement. Cela pourrait entra\u00eener l'ouverture automatique d'une grande surface.",
help_p6:"Pour supprimer un rep\u00e8re de bombe d'une face, pointez-le et cliquez \u00e0 nouveau avec le bouton droit de la souris. Les faces marqu\u00e9es ne peuvent pas \u00eatre ouvertes.",help_p7:"Si vous marquez une bombe de mani\u00e8re incorrecte, vous devrez corriger l'erreur avant de pouvoir gagner. Un marquage \u00e0 la bombe incorrect ne vous tuera pas, mais il peut en r\u00e9sulter des erreurs.",help_p8:"Vous n'avez pas besoin de marquer toutes les bombes pour gagner, il vous suffit d'ouvrir tout le visage non bombard\u00e9.",
help_p9:"Un clic droit deux fois vous donnera un symbole de point d'interrogation qui peut \u00eatre utile si vous n'\u00eates pas s\u00fbr d'un carr\u00e9. Cliquez \u00e0 nouveau avec le bouton droit de la souris pour supprimer le point d'interrogation.",help_quick_start:"D\u00e9marrage rapide",import_fatal_error_content:"La biblioth\u00e8que <b>{0}</b> n'a pas pu \u00eatre import\u00e9e du chemin <i>{1}</i>",import_fatal_error_title:"Erreur fatale de la biblioth\u00e8que",imported_dynamically_libs:"Les biblioth\u00e8ques suivantes: {0} ont \u00e9t\u00e9 import\u00e9es en {1} secondes",
